import React from 'react';
import {Link} from 'react-router-dom';
// Styles
import './NavBar.css';

export const NavBar = () => {
  return (
    <nav>
      <span>
        <Link to='/'>Home</Link>
        <Link to='/join'>Join a club</Link> 
        <Link to='/contact'>Contact us</Link>
      </span>
    </nav>
  );
}
